class Solution {
public:
    int minExtraChar(string s, vector<string>& dictionary) 
    {
        set<string> st;
        for(string& word:dictionary) st.insert(word);
        int n = s.size();
        vector<int> dp(n+1,n);
        for(int i = n-1; i >= 0; i--)
        {
            for(int j = i; j < n; j++)
            {
                if(st.find(s.substr(i, j-i+1)) != st.end())
                {
                    dp[i] = min(dp[i], dp[j+1]);
                }
            }
            dp[i] = min(dp[i], n-i);
        }
        return dp[0];
    }
};
```
In this code, dp[i] is the minimum number of extra characters left over if we break s up optimally starting at index i. We initialize dp[n] = n (this means there are n characters in s that are not in the dictionary). Then we loop from the end of the string to the beginning. For each substring, if it is in the dictionary, we update dp[i]=min(dp[i], dp[j+1]);. If it's not in the dictionary, we have to keep all characters, so we update dp[i]=min(dp[i], n-i);. Finally, after the loop, the minimum number of extra characters left over if we break s up optimally starting at index 0 is dp[0].
